import React from "react";
function Footer() {
  return (
    <header className="footer">
      <a href="https://www.linkedin.com/in/mohamed-wasim-mohamed-akram-7b8306208/">
        <img
          className="img1"
          alt="linkedInImg"
          src="https://www.iconsdb.com/icons/preview/white/linkedin-xxl.png"
        />
      </a>
      <a href="https://github.com/MohamedWasimMohamedAkram">
        <img
          className="img2"
          alt="gitHubImg"
          src="https://joshuapenalba.files.wordpress.com/2014/12/github-icon.png"
        />
      </a>
    </header>
  );
}
export default Footer;
